import Navbar from 'react-bootstrap/Navbar';
import Image from 'next/Image';

const NavBar = () => {
  return (
    <Navbar bg="light">
      <Navbar.Brand href="/">
        <p>NAvbar</p>
        <Image
          src="/logo.svg"
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="YQMF logo"
        />
      </Navbar.Brand>
    </Navbar>
  );
};

export default NavBar;
